export class ScheduleAPIService {

  constructor() { }

  getSchedules() : Observable<Schedule[]> {
    const schedules = [
      {
        name: 'Test',
        startDate: '1/1/2023',
        endDate: '2/1/2023',
        submissionDateTime : '12/31/2022 15:00:00z',
        status: 'Pending',
        icon: 'badge-info'
      }
    ];

    return of(schedules);
  }
}
